n\n心霊現象から身近に潜む恐怖まで、身の毛もよだつ恐怖話を収録したホラー読み物アプリ。\n\n ▼▼▼▼▼▼▼▼▼▼▼▼▼▼▼▼\n    ブック部門1位獲得!\n  ダウンロード数15万本突破!\n ▲▲▲▲▲▲▲▲▲▲▲▲▲▲▲▲\n\n──────────────────────\n▼現在、厳選された怖い話が約140話収録!\n──────────────────────\n \n 『常習犯』\n 1ヶ月に2回は寮を抜け出す高校生。\n 「またか」と気に留めない先生。\n しかし、その時だけは5日が過ぎても戻らない。\n 捜索願が出されて1年半後。\n 警察官から奇妙な写真を見せられる…\n\n 『ペンダント』\n 父親からの虐待をかばってくれた母親が、\n 生前くれたペンダント。\n 「幸せになれるように願いを込めてあるから、 絶対に開けちゃあ駄目」\n しかし、ある日。\n 転んだ衝撃で開けてしまった娘は\n 驚愕のメッセージを目にしてしまう…\n\n他にも、あなたの知らない本当に怖い話を現在、約130話収録。\n今後も随時記事を追加していく予定です。\n\n──────────────────────\n▼いつでもに手軽に楽しめる!\n──────────────────────\nオフラインでの閲覧も可能なので、\n電車移動中や休憩中、 待ち合わせや就寝前など、\n場所と時間を選ばずにじっくりと心霊体験談をお楽しみいただけます。\n\n──────────────────────\n▼未購読の記事も瞬時に分かる!\n──────────────────────\n観覧済みの記事のチェック機能を搭載。\n記事の観覧率表示機能も搭載。\n未購読の記事を探しやすいインターフェイスになっています。\n\n\n---------------------------------------------------------\n【対応端末】iPhone 3GS、iPhone 4、iPhone 4S\n【 対応OS 】iOS 4.0以上推奨\n---------------------------------------------------------\n【 ご注意 】\nアプリが落ちるというお客様は、以下の事をお試しいただけますでしょうか。\n①使っていないタスクを手動で終了させる\n②iPhoneを再起動\n\nそれでも落ちてしまうという場合は、お手数ですがデバイスとOSのバージョンをinfo@thomsons.jp宛てに送っていただけますと幸いです。引き続き原因を特定するための作業は行っております。ご迷惑をお掛けしているお客様、大変申し訳ございません。\n・デバイス:例)iPhone4s\n・デバイスのOS:例)iOS5.1.1', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2012-02-07T08:00:00Z', 'Thomson Inc.', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'jp.thomsons.Thomson002', 498719132, '実録！怖い話', 'Book', 6018, '▼期間限定の短編ホラー動画を追加しました。\nDVD「あなたの知らない怖い話」より「卒業写真」出演：篠崎愛 監督：福田陽平\n\n▼一部バグの修正を行いました。\n\n▼新たに8つの怖い話を追加しました。\n・まんまぁ\n・山道で後ろに居たのは…\n・闇の中の二つの光\n・後部座席の女\n・黒いモノ\n・赤い橋とオヤジ\n・残酷な日本の童謡\n・汚い水\n\n新たに加わった本当にあった怖い心霊体験談をどうぞお楽しみください。\nまた、ホラー動画コーナーのご感想を是非、お聞かせください！', 'software', '実録！怖い話', 'http://itunes.apple.com/jp/app/shi-lu!-bui-hua/id498719132?mt=8&uo=4', '9+', 'http://a5.mzstatic.com/us/r1000/107/Purple/v4/59/66/0f/59660f17-b054-c41b-d6f6-125fb1686ad0/mzl.njbnotsk.png', 'a:2:{i:0;s:2:\"EN\";i:1;s:2:\"JA\";}', '10846866', '9+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php