方で構いませんのでOSのVer,本体の種類（iPhone4）、ネット接続ありの時、など少しでも良いので情報を頂けないでしょうか。\n\n応援して頂いておりますアプリ利用者のお陰様で\n当アプリももうすぐ3年となります。\n\n本当にありがとうございます。\n\n======================================\n\n夏休みAmazonギフト券が当たるキャンペーン実地中！アプリから応募することが出来ます！\n\n======================================\n2chで有名な「意味がわかると怖い話」を集めたアプリです。\n「お気に入り」や「解説」機能を用意してあるので\n好きな時に好きな話を閲覧することが出来ます。\n======================================\n\n【収録内容一部】\n\n======================================\n       タイトル:井戸\n======================================\nある日、泣き声がしゃくに障ったので妹を殺した。死体は井戸に捨てた。\n次の日、見に行くと死体は消えていた。\n\n5年後、些細なけんかで友達を殺した。死体は井戸に捨てた。\n次の日見に行くと死体は消えていた。\n\n10年後、酔った勢いで孕ませてしまった女を殺した。死体は井戸に捨てた。\n次の日見に行くと死体は消えていた。\n\n15年後、嫌な上司を殺した。死体は井戸に捨てた。\n次の日、見に行くと死体は消えていた。\n\n20年後、介護が必要になった母が邪魔なので殺した。\n死体は井戸に捨てた。\n\n次の日、見に行くと死体は消えていなかった。\n次の日も、次の日も死体はそのままだった。\n======================================\n\n何故、死体がそのままだったのか・・・。\n答えはアプリの「検索」→「井戸」で!\n\n【Ver4.3】\n200話突破!!\n\n【DL数】\n累計100万DL突破しました。\n皆様、本当にありがとうございます。', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2011-01-14T02:28:31Z', 'saito hayato', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'Fear', 414219237, '意味がわかると怖い話', 'Book', 6018, '話を追加しました。', 'software', '意味がわかると怖い話', 'http://itunes.apple.com/jp/app/yi-weigawakaruto-bui-hua/id414219237?mt=8&uo=4', '12+', 'http://a4.mzstatic.com/us/r1000/066/Purple/v4/5b/99/45/5b9945ae-8b30-ab0d-8f24-881198a98262/mza_1741063427279960008.png', 'a:1:{i:0;s:2:\"JA\";}', '6861465', '12+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
