"http://a1.mzstatic.com/us/r1000/066/Purple/v4/c7/2a/5b/c72a5b62-5184-b766-3166-818a576338b7/mza_1411285238219490732.1024x1024-65.jpg\";i:4;s:132:\"http://a2.mzstatic.com/us/r1000/077/Purple/v4/f1/19/b1/f119b1ee-179c-fafb-b04d-76be026cc3ff/mza_2982688720595469539.1024x1024-65.jpg\";}', 'http://a1.mzstatic.com/us/r1000/072/Purple/v4/16/d6/eb/16d6ebe7-4c45-fee0-6878-948223ff7505/icon.png', 'http://a5.mzstatic.com/us/r1000/114/Purple/v4/7e/89/4e/7e894e17-9a02-3f6a-5de2-cf6f021a862b/mzl.hienjjqq.png', 'http://itunes.apple.com/jp/artist/adventure/id537914085?uo=4', 537914085, 'Adventure', 85.000000, '1.0.0', 'リリースキャンペーン８５円　９３．７７％オフ　　８月６日まで　書籍定価１，３６５円\n怖い、でも知りたい…普通の生活ではおよそ知ることができない危ない世界を覗き見る。\n裏社会を歩いている人も裏社会とは全く無縁の人も読んでおいて損はない、裏社会のガイドブックが登場！\n\n★iPhone総合ランキング１位獲得アプリ\n\nあの『裏社会のカラクリ』の著者が現役ヤクザやドラッグの密売人、違法賭博の従業員といった関係者に次々と体当たり取材を敢行!そこから見えてきたのは、表と裏の垣根が取り去られ、堅気とゴロツキが渾然一体と欲望に向かう、カオスの世界だった!\n\n●“超えてはいけない一線”、超えたらどうなる？\n\n●ヤクザの年収いくらですか？\n\n●ヤクザのシノギってどんなことをするの？ \n\n●とある大物俳優のドラッグ絡みのセックススキャンダルの行方\n\n●裏ギャンブルにハマったある一流企業勤務の真面目なサラリーマンの哀れな転落人生\n\n●マリファナ、覚せい剤、MDMA、LSD、コカイン…現代ドラッグの裏事情…密輸、密売方法とは？\n\n●ドキュメント人身売買…ホストにハマり、借金にまみれた女はこうして堕ちていく…\n\n\n限りなく怪しく危険な人々がうごめく裏社会。ヤクザ、シノギ、ギャンブル、ドラッグ、オンナ…裏社会の裏の裏まであなたをご案内しよう。だが本書を読んで知った気になり、安易な気持ちで裏社会に身を投じようなどとは思わない方がいい。“超えてはいけない一線”を見定めつつ、「裏社会の歩き方」を楽しんでいただきたい。\n\n■目次\n\nはじめに\n\n●第一章 ヤクザ社会の歩き方\n・【とってもハードな入社試験】 ヤクザに就職する方法\n・【恐怖のお宅拝見】 ヤクザの組事務所\n・【新人ヤクザの研修制度】 つらく厳しい部屋住み\n・【意地と見栄のガマンの世界】 ヤクザと刺青\n・【銃弾飛び交う男の舞台】 ヤクザと抗争\n・【掟を破れば待つのは地獄】 泣く子も黙る血の制裁\n・【今日限りで引退します】 ヤクザの退職・転職事情\n・【国民の義務もかたなし】 ヤクザの福利厚生\n他\n\n●第二章 ヤクザ社会のシノギ方\n・【禁制品を運び込む闇の商人】 密輸ブローカー\n・【芸能とヤクザの不適切な関係】 ショービジネス\n・【トラブルを解決すれば金になる】 示談交渉\n・【誰もが知っている大企業にも…?】 フロント企業\n・【気になるその金額は?】 ヤクザの年収\n他\n\n●第三章 非合法賭博の歩き方\n・【カードに託す一夜の夢】 アングラカジノ\n・【アングラギャンブルの王道】 裏スロ屋\n・【ハマれば哀れな地獄巡り】 裏ギャンブラーの末路\n他\n\n●第四章 クスリ社会の歩き方\n・【もはや他人ごとではない】 日本列島はドラッグ漬け!?\n・【知っておきたいマメ知識】 現代のドラッグ事情\n・【海や空から運び込む】 ドラッグ密輸法\n・【ドラッグ社会の末端分子】 プッシャー\n・【クスリでやられて頭がヘロヘロ】 ジャンキーに気をつけろ!\n・【巧妙化する隠蔽工作】 ドラッグの隠し方\n・【ダイオキシン入りのMDMAが摘発 】 ドラッグにまつわる怖い話\n\n●第五章 裏風俗の歩き方\n・【何が起こるかわからないマニアの殿堂】 ハプニングバー\n・【オニイサン、ヤスイヨ】 外国人エステ\n・【ほとばしるイマジネーション】 三行広告風俗\n・【裏風俗の最新トレンド】 裏風俗と韓国人\n・【ドキュメント人身売買】 女はこうして堕ちていく\n他\n\nおわりに\n\n著者 丸山佑介\n\n\n(株式会社彩図社×アプリ開発株式会社アドベンチャー)\n※この電子書籍は、2010年7月に株式会社彩図社から刊行された『裏社会の歩き方』を底本にしています。', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2012-07-17T09:02:26Z', 'Shunichi Nakamura', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'jp.co.adventure-inc.urashakai', 538370583, '裏社会の歩き方', 'Book', 6018, 'software', '裏社会の歩き方', 'a:4:{i:0;s:2:\"EN\";i:1;s:2:\"JA\";i:2;s:2:\"KO\";i:3;s:2:\"ZH\";}', '25762765', 'http://iphone.adventure-inc.co.jp/', '17+', 'http://a5.mzstatic.com/us/r1000/114/Purple/v4/7e/89/4e/7e894e17-9a02-3f6a-5de2-cf6f021a862b/mzl.hienjjqq.png', 'http://itunes.apple.com/jp/app/li-she-huino-buki-fang/id538370583?mt=8&uo=4', '17+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
