5的世論調査」機能を追加しました!\n いくつかの記事ページの下部に、投票コーナーが付いています。\n ぜひ、あなたの意見を投票してみてください。\n\n・R25アプリは記事更新時に記事データを端末に保存しますが、\n 「現在のデータ保存量」がわかるバーを画面上部に追加しました。\n 100%まで保存が完了するとバーは消えます。\n 保存完了後はアプリの表示が早くなり、またオフラインでもご覧いただけます。\n\n・アプリがクラッシュしてしまうエラーの改修対応をしております。\n ご迷惑をおかけした皆様にはお詫び申し上げます。\n\n\n今後とも、R25 for Androidをご愛顧いただきますよう\nよろしくお願いいたします。\n\n\nR25編集部\n\n\n\n[2012.04.04] 未読バッチの非表示方法について\n\n◆未読バッチとは?\nバッジを表示する設定にしている場合、 \nアプリアイコンの右上にまだ読んでいない記事の数を表すバッジを表示します。 \n\n◆バッジを表示させない方法\n「設定>通知>R25>Appアイコンバッジ表示(iOS4の方は「バッジ」)」を選択し「オフ」に切り替えてください。 \n\n何か気づいたことやご要望があれば、ぜひ編集部にお聞かせください。 \n\n\n-------------------------------------------------- \n\n 首都圏・大阪・名古屋を中心に55万部配布しているフリーマガジンR25の電子書籍版(iPhone版)。最新のR25を配布日当日に配信します。 \n\n 通勤時間や乗り換え時、待ち合わせの空き時間を活用した情報収集にはピッタリ。忙しい若手ビジネスマン必携のアプリです。\n\n【R25とは?】「18禁」ならぬ「25禁」の意。25才以上の男性ビジネスマン向けの情報誌を目指して創刊されました。政治もビジネスもスポーツも映画も、「オトコ視点」で編集しています。 \n\n【更新日】毎週月・木曜日 \n※月によって変更する場合があります \n\n【こんな方にオススメ!】\n・電車の乗り換え時やちょっとした待ち時間に、有意義な暇つぶしをしたい!という方\n・自宅でくつろぎながら、手軽に情報収集したい!という方\n・新聞、雑誌、ニュースサイト(ヤフー・ライブドアなど)をチェックするのが好きな方\n・産経新聞アプリ、ヤフートピックスアプリ、RSSリーダーアプリなどを愛用している方\n・日刊サイゾーアプリやカイジアプリなど、電子雑誌・書籍アプリを愛用している方', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2010-05-19T07:00:00Z', 'Mediashakers', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'jp.co.mediashakers.r25', 370559823, 'R25 for iPhone', 'Book', 6018, '・「R25的世論調査」機能を追加しました！\n　いくつかの記事ページの下部に、投票コーナーが付いています。\n　ぜひ、あなたの意見を投票してみてください。\n\n・R25アプリは記事更新時に記事データを端末に保存しますが、\n　「現在のデータ保存量」がわかるバーを画面上部に追加しました。\n　100％まで保存が完了するとバーは消えます。\n　保存完了後はアプリの表示が早くなり、またオフラインでもご覧いただけます。\n\n・アプリがクラッシュしてしまうエラーの改修対応をしております。\n　ご迷惑をおかけした皆様にはお詫び申し上げます。', 'software', 'R25 for iPhone', 'a:0:{}', '2971900', 'http://r25.jp/about/', '4+', 'http://a3.mzstatic.com/us/r1000/115/Purple/v4/f9/1d/c4/f91dc41e-a05e-9245-29fd-5971e22fb11e/mzl.gbwzitvi.png', 'http://itunes.apple.com/jp/app/r25-for-iphone/id370559823?mt=8&uo=4', '4+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
