、広告が表示されない有料版(http://itunes.apple.com/jp/app/shi-jieno-mi-xian-xing-geng/id502827042?mt=8)をご用意いたしましたので、広告が嫌な方は有料版でお楽しみくださいませ。\n※購入いただいた方への些細な感謝として無料版よりも先に謎を追加していきます。\n\n\n※[※注意]に関しまして※\n怖い系や凄惨な話が含まれる物にはタイトルの後に[※注意]をつけております。\n殺人事件やそういったものが嫌いな方は[※注意]がついている物は見ないことをお奨めします。\n\n※お礼※\n70万DLを突破いたしました。本当にありがとうございます。\nネタの面白さはもちろん、稚拙な文章、誤字脱字などまだまだ至らぬところが多いですが、できるかぎりがんばってまいりますのでこれからもよろしくお願いいたします。\n--------------------------------------------\n\nこのアプリは世界中にある謎に包まれた事件、人物、現象、予言、伝承、\n文明、都市伝説など、様々な謎への入口です。\n\n中には科学的に実証されたもの、創作とされるもの、決定的に否定されたものもありますが、謎へのロマンを残すため、否定論などの紹介はいたしません。\nあくまでこのアプリは謎への「入口」であり、より詳細な事を知りたい方はウィキペディアなどでお調べすることをお勧めいたします。\n\niOS3.2以上で動作します。\n\n\n--------------------------------------------\nTwitterでつぶやける機能を追加いたしました。謎の詳細ページ右上のボタンからつぶやくことができます。\n文章はいくつかのパターンの中から自動で選ばれますが、自由に編集してツイートいただけます。\n--------------------------------------------\n画像を追加しております。掲載している画像はウィキペディアなどにある著作権的に問題無いと思われるもののみを使用しておりますが、もし問題があった場合、その画像はすぐに削除いたします。\n--------------------------------------------\n\n\n※お願い※\nどうか謎に関する否定論などをレビューに書かないようにお願いいたします。\n当たり前ですが、アプリ自体のレビューはご自由にお書きください。', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2011-07-02T02:00:42Z', 'appli books Inc.', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'w.m.1', 447085266, '世界の謎', 'Book', 6018, '新たなコンテンツを追加いたしました。', 'software', '世界の謎', 'http://itunes.apple.com/jp/app/shi-jieno-mi/id447085266?mt=8&uo=4', '9+', 'http://a3.mzstatic.com/us/r1000/087/Purple/v4/5a/a7/41/5aa74188-6542-d90d-73a2-2e0cf41bbb06/mzl.oetkxhlw.jpg', 'a:1:{i:0;s:2:\"JA\";}', '14934041', 'http://', '9+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
