限が設定されている電子書籍がありますので、バックアップ機能をご利用ください。 \n\n★ その他、細かな不具合修正と機能改善を行いました。 \n\n◆　iCloud準拠に伴い、当アップデート後、ダウンロード済み電子書籍のキャッシュがクリアされる場合がございますので、オフラインでご覧になりたい電子書籍は再度ダウ-\nンロードしていただきますようお願いいたします。 \n大変ご不便をおかけいたしますが、ご理解のほどどうぞよろしくお願いいたします。', 'software', '雑誌オンライン+BOOKS', 'a:2:{i:0;s:2:\"EN\";i:1;s:2:\"JA\";}', '18758819', 'http://www.zasshi-online.com/', '17+', 'http://a1.mzstatic.com/us/r1000/085/Purple/v4/ed/7a/89/ed7a89ee-84f0-3637-482b-5fb12d9677d2/mzl.tnnijcgb.png', 'http://itunes.apple.com/jp/app/za-zhionrain+books/id324946616?mt=8&uo=4', '17+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
