d3/mza_802892165071888977.1024x1024-65.jpg\";i:2;s:132:\"http://a1.mzstatic.com/us/r1000/061/Purple/v4/60/98/b1/6098b17a-f686-47aa-a57f-6a13dbacd308/mza_1479243222900368790.1024x1024-65.jpg\";i:3;s:121:\"http://a2.mzstatic.com/us/r1000/103/Purple/v4/c7/69/c5/c769c516-f595-953b-be4b-845ddcc2d258/mzl.cuewswex.1024x1024-65.jpg\";i:4;s:121:\"http://a5.mzstatic.com/us/r1000/072/Purple/v4/70/d9/24/70d9241f-0ab6-0000-8480-9cbf17c2d4a8/mzl.kdzdfipd.1024x1024-65.jpg\";}', 'http://a1.mzstatic.com/us/r1000/078/Purple/v4/22/7e/04/227e04f6-b8a4-943b-3541-845b304807eb/mzl.qemqnguu.png', 357470726, 'KADOKAWA CONTENTS GATE Co.,Ltd', 0.000000, '2.3.3', '☆★ 神曲奏界ポリフォニカ クリムゾンS ★☆\n全6巻がそれぞれ250円！（8/2まで）\nhttp://bookwalker.jp/ex/sp/crimson_s_sp/\n\n☆★ TVアニメ放送中『ココロコネクト』 ★☆\n(5)～(8)が350円！（8/17まで）\nhttp://bookwalker.jp/ex/sp/kokoro_02/\n--------\n「BOOK☆WALKER」は角川グループ直営の電子書籍ストア・ビューア一体型のアプリです。角川書店や富士見書房、アスキー・メディアワークス、エンターブレイン、メディアファクトリーなどのライトノベル・コミック・文芸書など話題の電子書籍をお楽しみいただけます。\n\n紙との新刊同時発売作品、電子書籍オリジナルの漫画雑誌や文芸雑誌などが続々登場! 無料コンテンツも多数配信中です。\n\nご希望、ご要望等ありましたら、ぜひお寄せください。\n\n■ビューア機能\n・文字の拡大縮小(小説のみ)\n・縦組み・横組み切り替え(小説のみ)\n・テキスト検索(小説のみ)\n・ページジャンプ\n・明るさ調整\n\n■書籍管理機能\n・本棚デザインの切り替え\n・本の並び替え\n・本棚の追加/削除\n・一括ダウンロード/削除\n・購入履歴の端末間同期(会員登録が必要です)\n\n■販売中のおもな作品(毎週続々入荷中) \n\n/|||| コミック\n\nテルマエ・ロマエ\nエイジプレミアム\n乙嫁語り\n日常\n生徒会の一存\n新世紀エヴァンゲリオン\n未来日記\nFate/Zero\n\n/|||| ライトノベル\n\n「涼宮ハルヒ」シリーズ\nとある魔術の禁書目録\nバカとテストと召喚獣\n生徒会の一存\nハイスクールD×D\nフルメタル・パニック!\n這いよれ!ニャル子さん\nお兄ちゃんだけど愛さえあれば関係ないよねっ\n僕は友達が少ない\n\n/|||| 文芸\n\n氷菓\nSPEC\nAnother\nまおゆう魔王勇者\n万能鑑定士Qの事件簿\nGOSICK\n私の奴隷になりなさい\nデジタル野性時代\n小説屋sari-sari\n\n/|||| 新書・実用\n\n電撃ホビーマガジンbis\nレタスクラブ\n知らないと恥をかく世界の大問題\n図解で身につく!ドラッカーの理論\n庶民は知らないデフレの真実\nつい他人(ひと)に自慢したくなる 無敵の雑学\n\n/|||| ゲーム\n週刊ファミ通\n月刊アルカディア\nダークソウル 公式ガイドブック', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2010-12-03T03:46:44Z', 'KADOKAWA CONTENTS GATE', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'jp.bookwalker.iap01', 404123731, 'BOOK WALKER', 'Book', 6018, '【Ver.2.3.3更新内容】 \n・書籍一覧に検索機能をつけました。\n・初期設定と書籍の更新を一つにまとめました。\n・一覧の商品詳細画面にコンテンツのファイルサイズを表示するようにいたしました。\n・BOOK☆WALKERについて画面に総書籍数などを表示するようにいたしました。\n・一覧の「一括操作」ボタン名称を「編集」に変更いたしました。\n・一部のフォントが表示されない不具合を修正いたしました。\n\n【Ver.2.3.2(2012/4/26)更新内容】 \n・本棚画面で未ダウンロードの書籍を表示、ダウンロードを行えるようにいたしました。 \n・本棚画面で本の追加を行えるようにいたしました。 \n・本棚の編集画面で書籍の削除を行えるようにいたしました。 \n・本棚デザイン設定画面を本棚編集画面に移動しました。 \n\n【Ver.2.3.1(2012/4/9)更新内容】 \n・書籍のダウンロード、削除、本棚の移動をまとめてできるように機能追加しました。 \n・書籍一覧画面からダウンロード、閲覧が出来るように変更いたしました。 \n・ダウンロードが完了すると閲覧が始まるように変更いたしました。 \n・その他バグ修正を行いました。 \n\n\n【重要】2011年11月以降アプリを更新していないお客様へ \n■アプリを更新すると、ダウンロード済みの本がいったん端末から削除されます。アプリ更新後、本は次のどちらかの方法で再ダウンロードできます。 \n・購入画面からダウンロード（再課金はされません） \n・アプリ内[設定]→[初期設定]（この項目が表示されない場合は、会員登録してログインしてください）', 'software', 'BOOK WALKER', 'http://itunes.apple.com/jp/app/book-walker/id404123731?mt=8&uo=4', '17+', 'http://a1.mzstatic.com/us/r1000/078/Purple/v4/22/7e/04/227e04f6-b8a4-943b-3541-845b304807eb/mzl.qemqnguu.png', 'a:2:{i:0;s:2:\"EN\";i:1;s:2:\"JA\";}', '17035217', 'http://bookwalker.jp/', '17+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
