9330610180.1024x1024-65.jpg\";i:3;s:132:\"http://a4.mzstatic.com/us/r1000/070/Purple/v4/23/32/0b/23320b43-0516-66e1-1426-b5004b991894/mza_4187470746238763643.1024x1024-65.jpg\";i:4;s:132:\"http://a5.mzstatic.com/us/r1000/095/Purple/v4/52/dd/43/52dd433f-5738-6f23-4825-ba005d39c9db/mza_6520231794210247455.1024x1024-65.jpg\";}', 'http://a3.mzstatic.com/us/r1000/083/Purple/v4/8c/6a/a4/8c6aa4e5-9c5a-d79c-31d0-047eadc29d03/Icon.png', 'http://a1.mzstatic.com/us/r1000/093/Purple/v4/2f/49/24/2f492404-4108-d0ff-0eb1-86bd838b4b55/mza_8427220710902379503.png', 'http://itunes.apple.com/jp/artist/booklive-co.-ltd./id456859613?uo=4', 456859613, 'BookLive Co., Ltd.', 0.000000, '2.1.0', '★★BookLive!Readerが生まれ変わりました!★★ \n本棚デザインの刷新、操作性の向上で、分かりやすい、使いやすい電子書籍リーダーに進化しました。さらに、「本棚」と「しおり」のクラウド同期やシリーズ表示-\n、検索など新機能も追加し、より快適なデジタルドクショをお楽しみいただけます。 \n\n■BookLive! Readerの特徴 \nBookLive! Readerは、日本最大級の電子書籍ストア「BookLive!」で購入した電子書籍をダウンロード・閲覧するためのアプリケーションです。 \n\n「BookLive!」のマンガ、小説、雑誌、実用書、写真集を、iPhone、iPad、iPod touchでお楽しみいただけます。 \n既にお持ちの「BookLive!」の会員アカウントをBookLive! Readerに登録すると、購入済みの電子書籍が自動的に本棚に表示されます。お好みで本棚を追加して本を整理したり、本を並べ替えることができます。 \n\n☆電子書籍をクラウド管理 \n電子書籍ストア「BookLive!」では電子書籍をクラウド(サーバ)で管理しています。 \n端末を買い替えた場合でも、電子書籍を新しい端末に同期してお楽しみいただけます。また3台までの端末で本棚を同期できます。例えばお持ちのiPhoneで整-\n理した本棚をiPadや他の端末に反映することができます。 \n\n☆管理しやすい本棚 \nホーム画面に最近読んだ本を表示します。 \n本棚の切り替えは左右にフリックするだけ。新しい本棚を作ったり、本を移動するのも簡単です。 \nまた、マンガや雑誌などのシリーズ作品は、自動的にまとめて表示するようになりました。 \n\n☆読みやすいリーダー \n「BookLive!」で扱っているマンガ、小説、雑誌、実用書、写真集を読みやすい画面でお楽しみいただけます。フリックでページをめくったり、ピンチで画-\n像を拡大することができます。お好みで文字の大きさや色、行間、文字間、余白を調整したり、しおりを設置することもできます。読み終わったページの位置やしおりを他の-\n端末に同期することができますので、iPhoneで読んだ本をの続きをiPadで読むこともできます。', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6012\";}', '2011-10-07T02:14:01Z', 'BookLive Co., Ltd.', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:21:\"ライフスタイル\";}', 'jp.co.booklive', 456859610, 'BookLive! Reader', 'Book', 6018, '■EPUB形式の集英社マンガ作品に対応しました\n■安定性向上と表示不正に関する修正をおこないました\n・ダウンロードバーの表示不具合を修正\n・本棚編集に関する不具合を修正\n・雑誌閲覧時のダイアログ表示不具合を修正\n・本棚表示に関する不具合を修正\n・動画再生中、オフラインになった場合にアプリが落ちる不具合を修正\n・他の端末と同期できない場合がある不具合を修正\n\n※旧バージョンのiOSをご利用の方へ\nお使いの端末のOSがiOS4.3以前の場合、本アプリの動作が不安定になる場合があります。\niOS5.1以降にアップデートされることを推奨します。', 'software', 'BookLive! Reader', 'a:2:{i:0;s:2:\"EN\";i:1;s:2:\"JA\";}', '17201216', 'http://booklive.jp/', '4+', 'http://a1.mzstatic.com/us/r1000/093/Purple/v4/2f/49/24/2f492404-4108-d0ff-0eb1-86bd838b4b55/mza_8427220710902379503.png', 'http://itunes.apple.com/jp/app/booklive!-reader/id456859610?mt=8&uo=4', '4+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
