な人間が多数生息。彼らが軒並みＢ型であったことから、血液型に興味を持つ。', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2009-06-04T07:46:19Z', 'SANDBOX Co., Ltd.', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'jp.co.sandbox.AboutMebt', 315986074, 'B型自分の説明書 無料版', 'Book', 6018, 'チェック機能の追加', 'software', 'B型自分の説明書 無料版', 'a:1:{i:0;s:2:\"JA\";}', '868284', 'http://www.sandbox.co.jp', '4+', 'http://a4.mzstatic.com/us/r1000/049/Purple/b5/70/8a/mzl.oheacrnp.jpg', 'http://itunes.apple.com/jp/app/b-xing-zi-fenno-shuo-ming/id315986074?mt=8&uo=4', '4+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
