\n・画面上部 →目次へ \n・画面右  →前ページへ \n・画面左  →次ページへ \n  \n◇画面をタッチ×2回 \n・拡大 \n\n◇画面をフリック \n・左から右へ 次ページ \n・右から左へ 前ページ \n\n◇画面上部をタップすると、目次が表示されます。\n\n★ipadにも対応しております。\nipadをお持ちの方は、2倍モードでご覧ください。', 'a:2:{i:0;s:4:\"6018\";i:1;s:4:\"6016\";}', '2010-04-07T08:33:29Z', 'highstone Inc.', 'JPY', 'a:2:{i:0;s:9:\"ブック\";i:1;s:30:\"エンターテインメント\";}', 'com.highstone7.kaiji1', 365253394, 'カイジ　1', 'Book', 6018, 'バグを修正いたしました。', 'software', 'カイジ　1', 'a:1:{i:0;s:2:\"EN\";}', '9523522', 'http://twitter.com/highstonecojp', '17+', 'http://a4.mzstatic.com/us/r1000/059/Purple/f1/ee/51/mzl.hhphakhe.png', 'http://itunes.apple.com/jp/app/kaiji-1/id365253394?mt=8&uo=4', '17+', 'F', 'T')"' in /Users/makoto/moe/spider/fuel/core/classes/database/pdo/connection.php:167
